import React from 'react';
import '../App.css';
import {  useLocation } from 'react-router-dom';
import {  useParams } from 'react-router-dom';
import {useState} from 'react';
import Parser from 'html-react-parser';

function Form() {
  const loc = useLocation();
  console.log(loc);
  let {id} = useParams();
  let { idx, unit, name } = useParams();
  let [cnt, setCountER] = useState(0);

  var formen = "";
  if( id === 1 )
  {
    formen = "<form><input type='text'></form>";
  }

  return (
    <div className='Form'>
            <header class="App-header">
        <p>com.Form</p>
        <p>Case ID: { id }</p>
        <p>Case URL:  {loc.pathname}  </p>
        <p>Test params: {idx} Klasa {unit} Name {name}</p>
        <p>Proba przeslania from: {cnt}</p>
        Formularz: {Parser(formen)}

        <button onClick={()=>setCountER(cnt+1)}> + </button>
      </header>
    </div>
    
  );
}

export default Form;
